import React from 'react';
import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import SignIn from './pages/SignIn';
import Connect from './pages/Connect';
import CallMira from './pages/CallMira';
import './styles.css';

export default function App() {
  return (
    <BrowserRouter>
      {/* NAVBAR */}
      <nav className="w-full bg-white/20 backdrop-blur-md shadow-lg py-4 px-6 fixed top-0 z-50 border-b border-white/30">
        <div className="max-w-4xl mx-auto flex items-center justify-center gap-8">

          <NavLink 
            to="/" 
            className={({isActive}) =>
              `text-lg font-semibold transition duration-200 
              ${isActive ? "text-white border-b-2 border-white" : "text-white/70 hover:text-white"}`
            }
          >
            Sign In
          </NavLink>

          <NavLink 
            to="/connect" 
            className={({isActive}) =>
              `text-lg font-semibold transition duration-200 
              ${isActive ? "text-white border-b-2 border-white" : "text-white/70 hover:text-white"}`
            }
          >
            Connect
          </NavLink>

          <NavLink 
            to="/call" 
            className={({isActive}) =>
              `text-lg font-semibold transition duration-200 
              ${isActive ? "text-white border-b-2 border-white" : "text-white/70 hover:text-white"}`
            }
          >
            Call Mira
          </NavLink>

        </div>
      </nav>

      {/* MAIN CONTENT */}
      <div className="pt-24"> 
        <Routes>
          <Route path="/" element={<SignIn />} />
          <Route path="/connect" element={<Connect />} />
          <Route path="/call" element={<CallMira />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
